import React, { useContext, useState } from "react";
import { NavLink, useNavigate } from "react-router-dom";
import "./Polls.css";
import { Context } from "../..";

const Animals = () => {
    const [answer_1, setAnswer_1] = useState("");
    const [answer_2, setAnswer_2] = useState("");
    const [answer_3, setAnswer_3] = useState("");
    const [login, setLogin] = useState("");
    const [pool, setPool] = useState("");
    const navigate = useNavigate();

  const { user } = useContext(Context);

  try {
    if (
      email !== "" &&
      name !== "" &&
      surname !== "" &&
      email !== "" &&
      login !== "" &&
      password !== "" &&
      password2 !== ""
    );
    } catch (error) {}
  return (
    <div className="main__regis">
      <span className="zagolovok">Опрос 1</span>
      <div className="pp">
        <span className="p2">Имя</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setAnswer_1(e.target.value)}
          />
        </div>
      </div>
      <div className="pp">
        <span className="p2">Фамилия</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setAnswer_2(e.target.value)}
          />
        </div>
      </div>
      <div className="pp">
        <span className="p2">Почта</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setAnswer_3(e.target.value)}
          />
        </div>
      </div>
      <div className="pp">
        <span className="p2">Логин</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setLogin(e.target.value)}
          />
        </div>
      </div>
      <div className="pp">
        <span className="p2">Пароль</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setPool(e.target.value)}
          />
        </div>
      </div>
      <div className="pp">
        <span className="p2">Подтвердите Пароль</span>
        <div>
          <input
            className="inp"
            type="text"
            onChange={(e) => setPassword2(e.target.value)}
          />
        </div>
      </div>
      <div>
        <button type="button" className="regis__btn" onClick={regUser}>
          Зарегистрироваться
        </button>
        <div className="gg11">
          <span>Есть аккаунт?</span>
          <NavLink to={AUTH_ROUTE} className="navlink">
            Войти
          </NavLink>
        </div>
      </div>
    </div>
  );
};

